def transform(sequence):
    count = {}
    for num in sequence:
        if num in count:
            count[num] += 1
        else:
            count[num] = 1

    sorted_nums = sorted(count.keys(), key=lambda x: -count[x])

    transformed_seq = []
    for num in sequence:
        if num != sorted_nums[0]:
            transformed_seq.append(num)

    transformed_seq.insert(0, sorted_nums[0])
    return transformed_seq

